     * 48~63: Initial experience, len=16, 0-65535
     * 64~87: picId, len=24, the picture will save as itemId_picId.png, such as `3_12.png` it is the 12th pic in item#3
     * 88~95: artifactId_1, len=8
     * 96~111: artifactValue_1, len=16
